export const typeOfHouse = value => {
  return {
    type: "TYPE_OF_HOUSE",
    payload: value
  };
};

export const newGame = typedHouse => {
  return {
    type: "NEW_GAME",
    payload: typedHouse
  };
};

export const btnFood = () => {
  return {
    type: "BTN_FOOD"
  };
};
export const btnCatnip = () => {
  return {
    type: "BTN_CATNIP"
  };
};

